集群Cluster

集群,是层级布局(Hierarchy)的一种
该模块依赖一个层级布局(Hierarchy).md)结果,和一个画布区大小(size)。将层级布局数据中的节点赋予x和y坐标。集群图从叶子节点开始，自底向上，每一层节点对齐。
API
# d3.cluster() 
使用默认的配置创建一个新的系统树布局.
# cluster(root) 
对指定的 root hierarchy 进行布局，并为 root 以及它的每一个后代附加两个属性:

node.x - 节点的 x- 坐标
node.y - 节点的 y- 坐标

节点的 x 和 y 坐标可以是任意的坐标系统；例如你可以将 x 视为角度而将 y 视为半径来生成一个 radial layout(径向布局)。你也可以在布局之前使用 root.sort 进行排序操作。
# cluster.size([size]) 
如果指定了 size 则设置当前系统树布局的尺寸为一个指定的二元数值类型数组，表示 [width, height] 并返回当前系统树布局。如果 size 没有指定则返回当前系统树布局的尺寸，默认为 [1, 1]。如果返回的布局尺寸为 null 时则表示实际的尺寸根据 node size 确定。坐标 x 和 y 可以是任意的坐标系统；例如如果要生成一个 radial layout(径向布局) 则可以将其设置为 [360, radius] 用以表示角度范围为 360° 并且半径范围为 radius。
