层包Pack.html.body:
层包Pack

图使用嵌套来表示层次结构。最里层表示叶节点的圆的大小用来编码定量的维度值。每个圆都表示当前节点的近似累计大小，因为有空间浪费以及变形；仅仅只有叶节点可以准确的比较。尽管 circle packing 不能高效的利用空间，但是能更突出的表示层次结构。
该模块利用层级布局的数据进行包布局坐标计算。为层级布局数据添加布局信息用于绘制图形。以及一些内置API来设置或获取一些参数来辅助图形的坐标计算。
API
# d3.pack()
使用默认的设置创建一个打包布局。
# pack(root) 
对 root hierarchy 进行布局，root 节点以及每个后代节点会被附加以下属性:

node.x - 节点中心的 x- 坐标
node.y - 节点中心的 y- 坐标
node.r - 圆的半径

在传入布局之前必须调用 root.sum。可能还需要调用 root.sort 对节点进行排序。
# pack.radius([radius]) 
如果指定了 radius 则将半径访问器设置为指定的函数并返回 pack 布局。如果没有指定 radius 则返回当前半径访问器，默认为 null, 表示叶节点的圆的半径由叶节点的 node.value(通过 node.sum 计算) 得到；然后按照比例缩放以适应 layout size。如果半径访问器不为 null 则叶节点的半径由函数精确指定。
# pack.size([size]) 
如果指定了 size 则将当前 pack 布局的尺寸设置为指定的二元数值类型数组: [width, height] 并返回当前 pack 布局。如果没有指定 size 则返回当前的尺寸，默认为 [1, 1]。
# pack.padding([padding]) 
如果指定了 padding 则设置布局的间隔访问器为指定的数值或函数并返回 pack 布局。如果没有指定 padding 则返回当前的间隔访问器，默认为常量 0。当兄弟节点被打包时，节点之间的间隔会被设置为指定的间隔；外层包裹圆与字节点之间的间隔也会被设置为指定的间隔。如果没有指定 explicit radius(明确的半径)，则间隔是近似的，因为需要一个双通道算法来适应 layout size：这些圆首先没有间隙；一个用于计算间隔的比例因子会被计算；最后，这些圆被填充了。
布局信息
x:节点中心的 x- 坐标
y:节点中心的 y- 坐标
r:圆的半径
parent,children分别代表当前节点的父节点和子节点
const nodes = [
  {
    height: 2,
    depth: 0,
    parent: null,
    value: 950,
    x: 200,
    y: 300,
    r: 199.99999999999997,
    children:[Node,Node]
  }
]

基本数据
TODO
执行逻辑
TODO
核心代码
function pack(root) {
  root.x = dx / 2, root.y = dy / 2;
  if (radius) {
    //将叶子节点的大小，写入节点的r属性
    root.eachBefore(radiusLeaf(radius))
      //根据层级关系，对节点进行布局。(计算node.x,node.y值)
      .eachAfter(packChildren(padding, 0.5))
      //根据层级关系将子节点移到父节点上,由于指定了r就不再对node.r进行zoom
      .eachBefore(translateChild(1));
  } else {
    //将叶子节点的大小，写入节点的r属性
    root.eachBefore(radiusLeaf(defaultRadius))
      //根据层级关系，对节点进行布局。(计算node.x,node.y值)
      .eachAfter(packChildren(constantZero, 1))
      //对padding做了一些调整
      .eachAfter(packChildren(padding, root.r / Math.min(dx, dy)))
      //根据画布最小圆与root.r的比值对node.r进行zoom。 以及根据层级关系将子节点移到父节点上
      .eachBefore(translateChild(Math.min(dx, dy) / (2 * root.r)));
  }
  return root;
}

