执行逻辑

初始化力衰减常数alpha

在一个圆形区域内初始化节点对象，给节点写入index，x，y坐标，x，y方向上的速度（xv，yv）等。

启动力仿真，开始不断迭代直至力衰减常数，衰减至规定的最小值。

每次迭代中访问已定义的力，并传入当前力衰减系数。

各个连接节点之间的弹簧力：每两个发生连接的节点之间存在弹簧力，小于某个阈值时远离，大于某个值的靠近。最终趋于给定的阈值。将移动趋势写入速度。

各个节点之间的斥力：在场中的每个节点之间均存在斥力，基于四叉树进行优化计算所有节点间斥力，使节点相互远离，将移动趋势写入节点速度。

向心力：所有节点会有一个指向中心的力，所有节点向中心移动，将移动趋势写入速度。

根据节点的移动速度，移动节点，即将xv，yv写入，x，y。




